import "./childrenbodyhome.scss";
import Navbody from "../Navbody/navbody";
import {tabBar} from "../childrenbodytask/constant/constant";

const Childrenbodyhome = () => {
    const [tab,setTab] = useState({});
    const [home,setHome] = useState(false)
    const switchComponent = (name:string) => {
        setTab(name)
    }
    useEffect(()=>{
        setHome(true)
    },[])
    return (
        <div className="containerchildrenHome" >
            <Navbody switchs={switchComponent} home={home}  />
        </div>
    );
}

export default Childrenbodyhome;
